import React, { Component } from "react";
import TeamMember from "./MoviePart";
import MoviesInfo from "./MoviesInfo";

class Movies extends Component {
  constructor() {
    super();
    this.state = { info: MoviesInfo };
  }

  mapping(x) {
    const actors = x.map((actor) => (
      <TeamMember
        key={actor.id}
        img={actor.img}
        name={actor.name}
        release_dates={actor.release_dates}
        running_time={actor.running_time}
        language={actor.language}
      />
    ));
    return actors;
  }

  render() {
    return <div className="row"> {this.mapping(this.state.info)} </div>;
  }
}
export default Movies;
